import React from 'react'

const UpdateProducts = (props) => {
    return (
        <div>
            {props.pid}<br/>
            {props.pname}<br/>
            {props.pdesc}<br/>
            {props.pcat}<br/>
            {props.pprice}<br/>
            {props.puom}<br/>
            {props.ppic}
            
        </div>
    )
}

export default UpdateProducts
